literals:
query GetCandidates {
  candidates {
    id
    name
    email
    specialization
    status
    createdAt
    updatedAt
  }
}

query GetJobs {
  jobs {
    id
    title
    description
    openPositions
    createdAt
    updatedAt
  }
}

query getOfferIngredients {
  jobs {
    id
    title
  }
  candidates {
    id
    email
  }
}

query getOfferWithPin($pin: Int!, $id: ID!) {
  offerWithPin(pin: $pin, id: $id) {
    candidateName
    candidateEmail
    candidateSpecialization
    jobTitle
    jobDescription
    offerDescription
    userName
    userEmail
  }
}

query getUserByEmail($email: String!) {
  userByEmail(email: $email) {
    id
    email
    name
    createdAt
    updatedAt
  }
}

query getUserOffers($id: ID!) {
  user(id: $id) {
    offers {
      candidateEmail
      candidateId
      candidateName
      offerStatus
      offerId
      offerPin
      offerCreatedAt
      jobTitle
      jobId
    }
  }
}

